import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Redirect, Route, Switch } from "react-router-dom";
import Login from './Login/views/Login'
import Register from './Register/views/Register'
import Landing from "./Landing/views/Landing";
import Checkout from "./Payment/Checkout";
import "@fortawesome/fontawesome-free/css/all.min.css";
import './index.css'
import Pricing from "./Pricingplan/Pricing";
// import Bedcrump from "./SearchProperty/Bedcrump";
import Contact from './Contact/Contact'
import Blog from './Blog/Welcome/Blog'
import Search from './Search/Search'


ReactDOM.render(
  <BrowserRouter>
    <Switch>

      <Route exact path='/' component={Landing} />
      <Route exact component={Login} path='/login'/>
      <Route exact component={Register} path='/register'/>
      <Route  exact component={Checkout} path='/pay'/>
      <Route exact component={Pricing} path='/pricing'/>
      <Route exact component={Search} path='/search_property'/>
      <Route exact component={Blog} path='/blog'/>
       <Route exact component={Contact} path='/contact'/>






      {/* <Route component={Contact} path='/contact'/>
      <Route component={Bedcrump} path='/search_property'/>
      <Route component={listProperty} path='/list_property'/>
      <Route component={ViewProperty} path='/view_listing'/>
      <Route component={Blog} path='/blog'/>
      <Route exact  path="/make_listing" component={AddLists}/>
      <Route exact  path="/v2r_code" component={EnterCode}/> */}

    </Switch>
  </BrowserRouter>,
  document.getElementById("root")
);
